    false,nt"url": null,nt"notes": "NODC Accession 0115156 includes chemical,
    discrete sample, physical and profile data collected from KNORR in the North Pacific
    Ocean and South Pacific Ocean from 1992-10-06 to 1993-04-13 and retrieved during
    cruise WOCE_P16AP17A, WOCE_P17EP19S and WOCE_P19C. These data include CHLOROFLUOROCARBON-11
    (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA
    HELIUM-3, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE,
    NEON, NITRATE, NITRITE, PHOSPHATE, Partial pressure (or fugacity) of carbon dioxide,
    Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen isotope) and
    WATER TEMPERATURE. The instruments used to collect these data include CTD and bottle.
    These data were collected by Taro Takahashi and David Chipman of Columbia University;
    Lamont-Doherty Earth Observatory as part of the WOCE_P16AP17A, WOCE_P17EP19S and
    WOCE_P19C data set.nnThe World Ocean Circulation Experiment (WOCE) was a major component
    of the World Climate Research Program with the overall goal of better understanding
    the ocean's role in climate and climatic changes resulting from both natural and
    anthropogenic causes. The CO2 survey took advantage of the sampling opportunities
    provided by the WOCE Hydrographic Program (WHP) cruises during this period between
    1990 and 1998. The final collection covers approximately 23,000 stations from 94
    WOCE cruises.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
